void conv1()
{
    for(int i1 = 0; i1 < 1; i1++)
    {
        for(int i2 = 0; i2 < 4; i2++)
        {
            for(int i3 = 0; i3 < 24; i3++)
            {
                for(int i4 = 0; i4 < 24; i4++)
                {
                    for(int j1 = 0; j1 < 5; j1++)
                    {
                        for(int j2 = 0; j2 < 5; j2++)
                        {
                            layer_conv1[i2][i3][i4] += input[i1][i3 + j1][i4 + j2] * kernel1[i1][i2][j1][j2];
                        }
                    }
                }
            }
        }
    }
    for(int i2 = 0; i2 < 4; i2++)
    {
        for(int i3 = 0; i3 < 24; i3++)
        {
            for(int i4 = 0; i4 < 24; i4++)
            {
                layer_conv1[i2][i3][i4] = RELU(layer_conv1[i2][i3][i4] + bias1[i2]);
            }
        }
    }
}

void pooling1()
{
    for(int i2 = 0; i2 < 4; i2++)
    {
        for(int i3 = 0; i3 < 12; i3++)
        {
            for(int i4 = 0; i4 < 12; i4++)
            {
                layer_pooling1[i2][i3][i4] = MAX4(
                        layer_conv1[i2][i3 * 2][i4 * 2],
                        layer_conv1[i2][i3 * 2][i4 * 2 + 1],
                        layer_conv1[i2][i3 * 2 + 1][i4 * 2],
                        layer_conv1[i2][i3 * 2 + 1][i4 * 2 + 1]
                );
            }
        }
    }
}

void conv2()
{
    for(int i1 = 0; i1 < 4; i1++)
    {
        for(int i2 = 0; i2 < 12; i2++)
        {
            for(int i3 = 0; i3 < 8; i3++)
            {
                for(int i4 = 0; i4 < 8; i4++)
                {
                    for(int j1 = 0; j1 < 5; j1++)
                    {
                        for(int j2 = 0; j2 < 5; j2++)
                        {
                            layer_conv2[i2][i3][i4] += layer_pooling1[i1][i3 + j1][i4 + j2] * kernel2[i1][i2][j1][j2];
                        }
                    }
                }
            }
        }
    }
    for(int i2 = 0; i2 < 12; i2++)
    {
        for(int i3 = 0; i3 < 8; i3++)
        {
            for(int i4 = 0; i4 < 8; i4++)
            {
                layer_conv2[i2][i3][i4] = RELU(layer_conv2[i2][i3][i4] + bias2[i2]);
            }
        }
    }
}

void pooling2()
{
    for(int i2 = 0; i2 < 12; i2++)
    {
        for(int i3 = 0; i3 < 4; i3++)
        {
            for(int i4 = 0; i4 < 4; i4++)
            {
                layer_pooling2[i2][i3][i4] = MAX4(
                        layer_conv2[i2][i3 * 2][i4 * 2],
                        layer_conv2[i2][i3 * 2][i4 * 2 + 1],
                        layer_conv2[i2][i3 * 2 + 1][i4 * 2],
                        layer_conv2[i2][i3 * 2 + 1][i4 * 2 + 1]
                );
            }
        }
    }
}

void flatten1()
{
    for(int i1 = 0; i1 < 12; i1++)
    {
        for(int i2 = 0; i2 < 4; i2++)
        {
            for(int i3 = 0; i3 < 4; i3++)
            {
                layer_dense1[i1 + i2 * 48 + i3 * 12] = layer_pooling2[i1][i2][i3];
            }
        }
    }
}

void dense1()
{
    for(int i1 = 0; i1 < 10; i1++)
    {
        layer_output[i1] = 0;
        for(int i2 = 0; i2 < 192; i2++)
        {
            layer_output[i1] += layer_dense1[i2] * weight1[i1][i2];
        }
        layer_output[i1] += biases1[i1];
    }
}

void output()
{
    float sum = 0.0;

    for(int i = 0; i < 10; i++)
    {
        layer_output[i] = exp(layer_output[i]);
        sum += layer_output[i];
    }
    for(int i = 0; i < 10; i++)
    {
        printf("%f ", layer_output[i] / sum);
    }
    printf("\r\n");
}

